#![allow(dead_code)]
struct Solution;
impl Solution {
    pub fn check_palindrome_formation(a: String, b: String) -> bool {
        Solution::check(&a, &b) || Solution::check(&b, &a)
    }

    pub fn check(a: &String, b: &String) -> bool {
        let mut i = 0;
        let mut j = a.len() - 1;

        let a_ptr = a.as_ptr();
        let b_ptr = b.as_ptr();
        unsafe {
            while i < j && *a_ptr.offset(i as isize) as char == *b_ptr.offset(j as isize) as char {
                i += 1;
                j -= 1;
            }
        }

        Solution::is_palindrome(&a, i, j) || Solution::is_palindrome(&b, i, j)
    }

    pub fn is_palindrome(s: &String, mut i: usize, mut j: usize) -> bool {
        let s_ptr = s.as_ptr();
        unsafe {
            while i < j && *s_ptr.offset(i as isize) as char == *s_ptr.offset(j as isize) as char {
                i += 1;
                j -= 1;
            }
        }

        i >= j
    }
}

